import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <section className="hero-section">
      <div className="hero-background"></div>
      <div className="hero-overlay"></div>
      <div className="hero-content">
        <h1 className="hero-title">Herion</h1>
        <h2 className="hero-subtitle">New Album Available On</h2>
        <div className="hero-platforms">
          <a href="https://itunes.apple.com" target="_blank" rel="noopener noreferrer" aria-label="iTunes">
            <img src="https://upload.wikimedia.org/wikipedia/commons/4/4e/ITunes_Logo.svg" alt="iTunes" />
          </a>
          <a href="https://www.amazon.com" target="_blank" rel="noopener noreferrer" aria-label="Amazon">
            <img src="https://upload.wikimedia.org/wikipedia/commons/a/a9/Amazon_logo.svg" alt="Amazon" />
          </a>
          <a href="https://www.spotify.com" target="_blank" rel="noopener noreferrer" aria-label="Spotify">
            <img src="https://upload.wikimedia.org/wikipedia/commons/1/19/Spotify_logo_without_text.svg" alt="Spotify" />
          </a>
        </div>
      </div>
    </section>
  );
}

export default Hero;
